import {Link, useParams} from "react-router-dom";
import {useEffect, useState} from "react";
import {createAPIEndpoint, ENDPOINTS} from "../../api/axios";
import "./Project.css"

export const Project = (props) => {
    const {id} = useParams();
    const [project, setProject] = useState({});

    useEffect(() => {
        createAPIEndpoint(ENDPOINTS.projects).fetchById(id)
            .then(res => {
                setProject(res.data)
                console.log(res.data)
            })
            .catch(err => {
                console.log(err);
            });
    }, [id])

    if (!project) {
        return <div>Loading...</div>;
    }

    const getTaskStatusColor = (status) => {
        switch (status) {
            case 1:
                return "#ED2939";
            case 2:
                return "#F5DE10";
            case 3:
                return "#29AB87";
            default:
                return "#FFFFFF";
        }
    };

    return (
        <div className="container d-flex flex-column flex-grow-1 white-box-project pb-4 px-2">
            <h2 className="dark-blue">{project.title}</h2>
            <p className="light-blue">Started on {project.dateStarted}</p>

            <h3>Project Members:</h3>
            <div className="d-flex flex-wrap flex-row">
                {project.projectMembers && project.projectMembers.map((member) => (
                    <Link className="project-link" to={"/users/" + member.id} key={member.id}>
                        <div className="user-card" key={member.id}>
                            <img src={member.profilePictureSrc} className="user-avatar mx-auto" alt="Profile Avatar"/>
                            <p className="user-name">{member.userName}</p>
                        </div>
                    </Link>

                ))}
            </div>

            <h3>Tasks:</h3>
            <div className="d-flex flex-wrap flex-row ">
                {/*{project.tasks && project.tasks.map((task) => (*/}
                {/*    <Link className="project-link" to={"/tasks/"+task.id} key={task.id}>*/}
                {/*        <div className="task-card" key={task.id} style={{*/}
                {/*            backgroundColor: getTaskStatusColor(task.status),*/}
                {/*        }}>*/}
                {/*            <p className="user-name">{task.description}</p>*/}
                {/*        </div>*/}
                {/*    </Link>*/}
                {/*))}*/}
                <Link className="project-link" to={"/tasks/"}>
                    <div className="task-card" style={{
                        backgroundColor: getTaskStatusColor(1),
                    }}>
                        <p className="user-name cream">Lorem ipsum dolor sit amet, consectetur adipisicing elit. Cum
                            dolorum
                            enim, id mollitia officiis quaerat.</p>
                    </div>
                </Link>
                <Link className="project-link" to={"/tasks/"}>
                    <div className="task-card" style={{
                        backgroundColor: getTaskStatusColor(2),
                    }}>
                        <p className="user-name cream">Lorem ipsum dolor sit amet, consectetur adipisicing elit. Cum
                            dolorum
                            enim, id mollitia officiis quaerat.</p>
                    </div>
                </Link>
                <Link className="project-link" to={"/tasks/"}>
                    <div className="task-card" style={{
                        backgroundColor: getTaskStatusColor(2),
                    }}>
                        <p className="user-name cream">Lorem ipsum dolor sit amet, consectetur adipisicing elit. Cum
                            dolorum
                            enim, id mollitia officiis quaerat.</p>
                    </div>
                </Link>
                <Link className="project-link" to={"/tasks/"}>
                    <div className="task-card" style={{
                        backgroundColor: getTaskStatusColor(1),
                    }}>
                        <p className="user-name cream">Lorem ipsum dolor sit amet, consectetur adipisicing elit. Cum
                            dolorum enim, id mollitia officiis quaerat.</p>
                    </div>
                </Link>
                <Link className="project-link" to={"/tasks/"}>
                    <div className="task-card" style={{
                        backgroundColor: getTaskStatusColor(3),
                    }}>
                        <p className="user-name cream">Lorem ipsum dolor sit amet, consectetur adipisicing elit. Cum
                            dolorum
                            enim, id mollitia officiis quaerat.</p>
                    </div>
                </Link>
                <Link className="project-link" to={"/tasks/"}>
                    <div className="task-card" style={{
                        backgroundColor: getTaskStatusColor(3),
                    }}>
                        <p className="user-name cream">Lorem ipsum dolor sit amet, consectetur adipisicing elit. Cum
                            dolorum enim, id mollitia officiis quaerat.</p>
                    </div>
                </Link>
            </div>
            <button className="btn pill-btn">Add Task</button>
        </div>
    );
};
